#include "FakeWalk.h"
#include "shonaxsettings.h"
FakeWalk fakewalk;

void FakeWalk::run(CUserCmd* m_pcmd, bool& send_packet)
{
	
	auto m_local = game::localdata.localplayer();
	if (m_local->GetFlags() & FL_ONGROUND) {
		if (!(m_local->GetFlags() & (int)FL_INWATER)) {
			if (Shonax::settingsxd.fakewalk1 && GetAsyncKeyState(Shonax::settingsxd.fakewalkhotkey)) {
				static int choked = 0;
				choked = choked > 7 ? 0 : choked + 1;
				m_pcmd->forwardmove = choked < 2 || choked > 5 ? 0 : m_pcmd->forwardmove;
				m_pcmd->sidemove = choked < 2 || choked > 5 ? 0 : m_pcmd->sidemove;
				send_packet = choked < 1;

			}
		}
	}
}

